export class Utils {
    static getDate() {
        const date = new Date();
        const year = date.getFullYear();
        const month = date.getMonth() + 1;
        const day =  date.getDate();
        const parsedDate = `${year}-0${month}-${day}`;
        return parsedDate;
    }
}
